import React, { useState, useEffect } from 'react';
import { Slider, Button, Space } from 'antd';
import { ZoomInOutlined, ZoomOutOutlined, ReloadOutlined } from '@ant-design/icons';
import './ComparisonView.css';

function ComparisonView({ originalImage, processedImage }) {
  const [zoom, setZoom] = useState(1);
  const [position, setPosition] = useState({ x: 0, y: 0 });
  const [isDragging, setIsDragging] = useState(false);
  const [startPosition, setStartPosition] = useState({ x: 0, y: 0 });
  const [brightness, setBrightness] = useState(100);
  const [contrast, setContrast] = useState(100);

  const handleZoomIn = () => {
    setZoom(prev => Math.min(prev + 0.1, 3));
  };

  const handleZoomOut = () => {
    setZoom(prev => Math.max(prev - 0.1, 0.5));
  };

  const handleReset = () => {
    setZoom(1);
    setPosition({ x: 0, y: 0 });
    setBrightness(100);
    setContrast(100);
  };

  const handleMouseDown = (e) => {
    setIsDragging(true);
    setStartPosition({
      x: e.clientX - position.x,
      y: e.clientY - position.y
    });
  };

  const handleMouseMove = (e) => {
    if (!isDragging) return;
    setPosition({
      x: e.clientX - startPosition.x,
      y: e.clientY - startPosition.y
    });
  };

  const handleMouseUp = () => {
    setIsDragging(false);
  };

  useEffect(() => {
    window.addEventListener('mouseup', handleMouseUp);
    return () => window.removeEventListener('mouseup', handleMouseUp);
  }, []);

  const imageStyle = {
    transform: `scale(${zoom}) translate(${position.x}px, ${position.y}px)`,
    filter: `brightness(${brightness}%) contrast(${contrast}%)`,
    cursor: isDragging ? 'grabbing' : 'grab'
  };

  return (
    <div className="comparison-container">
      <div className="controls">
        <Space>
          <Button icon={<ZoomInOutlined />} onClick={handleZoomIn}>放大</Button>
          <Button icon={<ZoomOutOutlined />} onClick={handleZoomOut}>缩小</Button>
          <Button icon={<ReloadOutlined />} onClick={handleReset}>重置</Button>
        </Space>
        
        <div className="slider-controls">
          <div className="slider-item">
            <span>亮度</span>
            <Slider
              min={0}
              max={200}
              value={brightness}
              onChange={setBrightness}
              style={{ width: 200 }}
            />
          </div>
          <div className="slider-item">
            <span>对比度</span>
            <Slider
              min={0}
              max={200}
              value={contrast}
              onChange={setContrast}
              style={{ width: 200 }}
            />
          </div>
        </div>
      </div>

      <div className="image-comparison">
        <div className="image-container">
          <h3>原始图像</h3>
          <div 
            className="image-wrapper"
            onMouseDown={handleMouseDown}
            onMouseMove={handleMouseMove}
            style={imageStyle}
          >
            <img src={originalImage} alt="原始MRI图像" />
          </div>
        </div>
        <div className="image-container">
          <h3>处理后图像</h3>
          <div 
            className="image-wrapper"
            onMouseDown={handleMouseDown}
            onMouseMove={handleMouseMove}
            style={imageStyle}
          >
            <img src={processedImage} alt="处理后MRI图像" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default ComparisonView;
